    "/*--------------------------------------------------------------------------*/",
    "#if (FXAA_GLSL_120 == 1)",
    "    // Requires,",
    "    //  #version 120",
    "    // And at least,",
    "    //  #extension GL_EXT_gpu_shader4 : enable",
